import React, { useEffect, useState } from "react";
import { Helmet } from "react-helmet";
import { Text } from "../../components/Text/Text.jsx";
import bookImage from "../../assets/book.png";
import { getNotes } from "../api"; // Import getNotes function
import { useAuthStore } from "../store/auth"; // Import auth store to get token
import { useHistory } from "react-router-dom"; // Import useHistory for redirection

export default function SavedPage() {
  const { token } = useAuthStore(); // Get token from auth store
  const [notes, setNotes] = useState([]);
  const history = useHistory(); // Get history for redirection

  useEffect(() => {
    const fetchNotes = async () => {
      try {
        const notes = await getNotes(token);
        setNotes(notes);
        if (notes.length === 0) {
          history.push("/not-saved");
        }
      } catch (error) {
        console.error("Failed to fetch notes:", error);
      }
    };

    fetchNotes();
  }, [token, history]);

  return (
    <>
      <Helmet>
        <title>criticowl</title>
        <meta name="description" content="Web site created using create-react-app" />
      </Helmet>
      <div className="flex w-full flex-col items-start gap-7 md:pb-5 p-5">
        <Text size="md" as="p" className="mb-5">
          Saved
        </Text>
        <div className="flex flex-col gap-[33px] w-full">
          {notes.map((note) => (
            <div key={note.id} className="flex flex-col items-start gap-5">
              <img src={bookImage} alt="image" className="h-[134px] w-auto" />
              <Text size="xs" as="p">
                {note.title}
              </Text>
              <Text size="xs" as="p">
                {note.content}
              </Text>
            </div>
          ))}
        </div>
      </div>
    </>
  );
}
